import { BrowserRouter as Router, Routes, Route } from "react-router-dom"
import LoginCustomer from "./components/LoginCustomer"


function App() {
  return (
    <Router>
      <Routes>
        <Route exact path="/" element={<LoginCustomer />}/>
      </Routes>
    </Router>
  );
}

export default App;
